import { map, filter, cloneDeep } from 'lodash-es';
import dayjs from 'dayjs';

export function processData(data) {
  return map(data, item => ({
    ...item,
    timestamp: dayjs().format('YYYY-MM-DD'),
    processed: true
  }));
}

export function filterValidData(data) {
  return filter(data, item => item && typeof item === 'object');
}

export function deepCloneData(data) {
  return cloneDeep(data);
}

// Re-export specific functions for external use
export { map, filter, cloneDeep, dayjs };
